function User(props){
    return(
        <tr className="row">
            <td> {props.user.id} </td>
            <td> {props.user.firstName} </td>
            <td> {props.user.lastName} </td>
            <td> {props.user.dob} </td>
        </tr>
    )
}

const app = (
    <table>
        <tr>
            <th>ID</th>
            <th>firstName</th>
            <th>lastName</th>
            <th>dob</th>
        </tr>
    </table>
) 

ReactDOM.render(<User user={{id: 1, firstName: 'John', lastName: 'Smith', dob:'02'}} />, document.getElementById('root'));
